import { Injectable } from '@angular/core';
import { HttpClient, HttpHeaders, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';
import { Patient } from 'src/app/models/Patient';

@Injectable({
  providedIn: 'root'
})
export class PatientbackService {

  private baseUrl = 'https://localhost:7129/api/Patient';

  constructor(private http: HttpClient) { }

  create2(patient: Patient): Observable<any> {
    return this.http.post(`${this.baseUrl}/create`, patient, { observe: 'response' });
  }

  getNiveauxEducations(): Observable<NiveauEducation[]> {
    return this.http.get<NiveauEducation[]>(`${this.baseUrl}/niveauxEducations`);
  }

  getCategoriesMaladie(): Observable<CategorieMaladie[]> {
    return this.http.get<CategorieMaladie[]>(`${this.baseUrl}/categoriesMaladie`);
  }
  edit(id: number, patient: Patient): Observable<any> {
    return this.http.put(`${this.baseUrl}/edit/${id}`, patient, { observe: 'response' });
  }

  getPatient(): Observable<Patient[]> {
    console.log(this.http.get<Patient[]>(this.baseUrl));
    return this.http.get<Patient[]>(this.baseUrl);
  }
}
